INSERT INTO `items` (`id`, `type`, `name`, `created_at`, `updated_at`, `info_node_info_node_id`, `body`, `value`, `sort_code`, `view`) VALUES (713,'Section','This is a doc section','2008-04-27 19:07:53','2008-04-27 19:07:59',708,'Textile is a lightweight markup language originally developed by Dean Allen and billed as a \"humane Web text generator\". Textile converts its marked-up text input to valid, well-formed XHTML and also inserts character entity references for apostrophes, opening and closing single and double quotation marks, ellipses and em dashes.\n\nTextile was originally implemented in PHP, but has been translated into other programming languages including Perl, Python, Ruby, ASP, Java and C#.\n\nTextile is distributed under a BSD-style license and is included with, or available as a plugin for, several content-management systems.\n\nVersion 2.0 beta was released in 2004 as part of the Textpattern content management system.\n\nVersion 2.0 was released in 2006.',NULL,712,NULL);
