INSERT INTO `items` (`id`, `type`, `name`, `created_at`, `updated_at`, `info_node_info_node_id`, `body`, `value`, `sort_code`, `view`) VALUES (748,'InfoNode','bus word info','2008-04-30 09:23:18','2008-05-02 18:14:11',747,NULL,NULL,748,'<h1 name=\"hlist_name\" id=\"hlist_name\" style=\"color:maroon; margin-botom:8px;\">\n<%=@node.name%>\n</h1>\n\n<div>\n\n<div style=\"float:left; width:45%; margin:10px;\">\n<%= labeled_node_list \"Abbreviations\" %>\n</div>\n\n<% \n  words = @in_refs.select{|rn| rn.name == \"Words\"}\n  terms = words.collect{|ref| ref.parent}\n%>\n\n<div style=\"float:left; width:45%; margin:10px;\">\n<%= labeled_node_list terms, {:label => \'Used In Terms\'} %>\n</div>\n\n</div>');
