INSERT INTO `items` (`id`, `type`, `name`, `created_at`, `updated_at`, `info_node_info_node_id`, `body`, `value`, `sort_code`, `view`) VALUES (751,'InfoNode','bus term info','2008-04-30 09:29:45','2008-05-04 14:09:27',747,NULL,NULL,751,'<h1 style=\"color:maroon;\"><%=@node.name%></h1>\r\n\r\n<div style=\"float:left; width:30%; margin:10px;\">\r\n	<%= labeled_node_list \"Words\"%>\r\n</div>\r\n\r\n\r\n<div style=\"float:left; width:30%; margin:10px;\">\r\n	\r\n<div style=\" border:solid 1px black;\">\r\n	<div style=\"padding:0px 3px 0px 3px; color:white; background:navy; border-bottom:solid 1px black;\">\r\n		Attributes\r\n	</div>\r\n	<div style=\"padding:1px 3px 0px 3px; color:black; background:white;\">\r\n		<% for attr in @attributes %>\r\n			<p style=\"margin:0px; padding:0px;\"><%=attr.name%> : <%=attr.value%></p>\r\n		<% end %>\r\n	</div>\r\n</div>\r\n\r\n</div>\r\n\r\n\r\n<div style=\"float:left; width:30%; margin:10px;\">\r\n\r\n<%\r\n  words = @node.get_subnodes_of(\"Words\")\r\n  words_nodes = referrers_to(words)\r\n  others = parents_of(words_nodes)\r\n  related_terms = others.delete_if {|node| node == @node}  \r\n%>\r\n\r\n<%= labeled_node_list related_terms, :label => \'Related Terms\' %>\r\n\r\n</div>\r\n\r\n<div style=\"float:right; width:25%; margin-right:30px; margin-top:20px;\">\r\n\r\n<h3><%= link_to \"All Business Terms\", url_show(@node.parent) %></h3>\r\n\r\n<div style=\"width:100%; padding:4px; background:transparent; border:solid 1px black; height:2in; overflow:auto;\">\r\n    <% for item in elements_with_all_tags(\"is_bus_term\").sort{|i1,i2| i1.iname <=> i2.iname} do %>\r\n             <p style=\"background:transparent; margin:0px 0px 0px 10px;\">\r\n             <%= link_to item.iname, :action => \'show_element\', :id => item %>\r\n             </p>\r\n    <% end %>\r\n</div>\r\n\r\n</div>\r\n\r\n\r\n<div class=\"docs\" style=\"float:left; width:65%;\">\r\n       <% for doc in @docs do %>\r\n		<div class=\"view_doc\">\r\n			<div class=\"view_doc_name\"><%=doc.name%></div>\r\n			<div class=\"view_doc_body\"><%=rc_format(doc.body)%></div>\r\n		</div>\r\n	<% end %>\r\n</div>\r\n\r\n       ');
