INSERT INTO `items` (`id`, `type`, `name`, `created_at`, `updated_at`, `info_node_info_node_id`, `body`, `value`, `sort_code`, `view`) VALUES (1453,'InfoNode','Bishops','2008-06-24 19:17:24','2008-12-09 12:54:58',781,NULL,NULL,1453,'<p class=\"spacer\">&nbsp;</p>\n\n<%\n   bishops = elements_with_all_tags(\'is_person\')\n   bishops = bishops.select{|p| [\'Bishop\',\'Branch President\'].include?(p.get_attr_value(\'Calling\')) } \n\n   emails = bishops.collect{|p| \"#{p.name} &lt;#{p.get_attr_value(\'Email\')}&gt;\" }\n%>\n\n<%= labeled_node_list bishops, :label => \'Bishops\' %>\n\n<h3>Bishop (or Counselor) E-Mail Addresses (comma separated)</h3>\n\n<p>\n<%= emails.join(\",<br />\")  %>\n</p>\n\n<h3>Bishoprics and Stake Leadership (as of 12/08)</h3>\n<p>\nmatt.r.allen@gmail.com, thmsarmtg@aol.com, tlbadstubn@aol.com, bungybug@comcast.net, mabsaguaro@comcast.net, bradbennion@verizon.net, berryphotos@comcast.net, stevebetznotary@aol.com, john.biega@verizon.net, dpblackburn@gmail.com, bart.byerly@genzyme.com, jcalkins@detma.org, rgc8146@aol.com, rclarke55@gmail.com, cookad@yahoo.com, corb.doug@epa.gov, phcorkum@juno.com, doaners@yahoo.com, cgdoughty@aol.com, d_eastman@hotmail.com, leif.erickson@fmr.com, tom-flanagan@comcast.net, joegiles2@yahoo.com, griggw@southcoast.org, bobgrovescc@aol.com, jesseohansen@yahoo.com, codyscottharward@yahoo.com, jodyheaton@mac.com, schigginson@verizon.net, c.hocking@comcast.net, jimirey2@gmail.com, dlandrith@mac.com, gdlaws@comcast.net, PaulLeitch_@msn.com, jimack104@comcast.net, KMacKaybyu@hotmail.com, csmaire@aol.com, miles.davemiles@gmail.com, gmoessing@netscape.net, brockandkristina@gmail.com, Scottorton@Hotmail.com, billpellegrini@yahoo.com, ffkp19@earthlink.net, japeterson@deloitte.com, barbarapeterson43@attbi.com, jonathanpolleys@comcast.net, OldMayhewFarm@gmail.com, rick.rice@live.com, usafe7ret@gmail.com, nathan@sandlands.org, mark.small6@verizon.net, evan.smith@bingham.com, Sean_Spearin@hillspet.com, paulspencerlds@yahoo.com, cj