INSERT INTO `items` (`id`, `type`, `name`, `created_at`, `updated_at`, `info_node_info_node_id`, `body`, `value`, `sort_code`, `view`) VALUES (1454,'InfoNode','Unit Leadership Directory','2008-06-25 11:28:30','2008-06-26 14:15:30',781,NULL,NULL,1454,'<div>\n\n   <h3>Unit Leadership Directory</h3>\n\n   <% for unit in @node.parent.get_subnodes_of(\"Units\") %>\n      <h5 style=\"margin-top:12px;\"><%=unit.name%></h5>\n      <%= table_of_subnodes unit.get_subnode_by_name(\"Leadership\"), :order_by => \'Calling\' %>\n   <% end %>\n\n</div>');
INSERT INTO `items` (`id`, `type`, `name`, `created_at`, `updated_at`, `info_node_info_node_id`, `body`, `value`, `sort_code`, `view`) VALUES (1455,'InfoNode','Missionaries','2008-06-25 11:54:20','2008-06-25 11:57:06',781,NULL,NULL,1455,'<div>\n   <h3>Missionaries</h3>\n   <% for unit in @node.parent.get_subnodes_of(\"Units\") %>\n      <% missionaries = unit.get_subnode_by_name(\"Missionaries Out\").children %>\n      <% if missionaries.size > 0 %>\n         <div style=\"float:left; width:28%; margin-left:1%; margin-top:12px;\">\n         <h5><%=unit.name%></h5>\n         <%= table_of_subnodes missionaries %>\n         </div>\n      <% end %>\n   <% end %>\n</div>');
