INSERT INTO `items` (`id`, `type`, `name`, `created_at`, `updated_at`, `info_node_info_node_id`, `body`, `value`, `sort_code`, `view`) VALUES (1545,'Section','wiki page','2008-07-02 08:07:30','2009-07-25 09:45:43',1544,'The topics under this one are meant to be the starting points for topics that individual users would catalogue. \r\n\r\n\r\nLook to the left margin for the current subtopics of this topic. \r\n\r\nYou can add another... \r\n\r\nNext level subtopics can be enumerated in a list like this (see edit view):\r\n[[>]]\r\n\r\nThat\'s easy.\r\n\r\nHow about a table of their attributes:\r\n\r\n||>||\r\n\r\nAlso easy.\r\n\r\n[[>Fred]] is a ref to Fred\'s page and only if it is directly below this topic.\r\n\r\n\r\nh2. Topic page inclusions by ID and by name\r\n\r\n<table>\r\n<tr>\r\n<td valign=\"top\">{{1558}}</td>\r\n<td valign=\"top\">{{Diana}}</td>\r\n</tr>\r\n</table>\r\n',NULL,1545,NULL);
