INSERT INTO `items` (`id`, `type`, `name`, `created_at`, `updated_at`, `info_node_info_node_id`, `body`, `value`, `sort_code`, `view`) VALUES (1549,'Section','wiki page','2008-07-02 08:49:30','2008-07-16 13:37:21',1548,'Please add your comments here:\n\n* Need a better explanation of attributes.\n\n* Need to be able to assign attributes to multiple selected topics at once\n* Need to be able to assign tags to multiple selected topics at once\n* Add the notion of a \"select list\" to support the above\n\n* Need a tabular edit view (like a spreadsheet) for editing attributes in cells, having the selected objects all in rows. \n\n* The need to go to the Edit view to add/modify attributes seems too \"modal\" ... it should be possible right in the topic view page (as it is for tags)',NULL,1549,NULL);
