INSERT INTO `items` (`id`, `type`, `name`, `created_at`, `updated_at`, `info_node_info_node_id`, `body`, `value`, `sort_code`, `view`) VALUES (1618,'Section','wiki page','2008-07-06 16:46:42','2008-11-20 04:33:20',1611,'!goldie1.jpg!\n\nh5. Bottlefeeding Goldie having been orphaned after the death of her mother [[Caramel]].  \n\n[[Marshie]] adopted Goldie and fed and cared for her as if she was part of her own [[Litter #1]]\n\n<div><object width=\"425\" height=\"344\"><param name=\"movie\" value=\"http://www.youtube.com/v/TXNqbIwN3P8&hl=en&fs=1\"></param><param name=\"allowFullScreen\" value=\"true\"></param><embed src=\"http://www.youtube.com/v/TXNqbIwN3P8&hl=en&fs=1\" type=\"application/x-shockwave-flash\" allowfullscreen=\"true\" width=\"425\" height=\"344\"></embed></object></div>\n\nGoldie died suddenly (apparently of dehydration) on November 9, 2008',NULL,1618,NULL);
