INSERT INTO `items` (`id`, `type`, `name`, `created_at`, `updated_at`, `info_node_info_node_id`, `body`, `value`, `sort_code`, `view`) VALUES (1620,'Section','wiki page','2008-07-06 16:47:32','2008-09-28 22:07:45',1619,'!caramel.jpg!\n\nCaramel is the mother of [[Goldie]], she is also the mother of [[Toffee]]\n\nCaramel has had three litters of babies\n\nCaramel and [[Butterscotch]] had [[Litter #1]] on August 8, 2005 <br /> \nCaramel and [[Butterscotch]] had [[Litter #2]] on February 2, 2006 <br />\nCaramel and [[Butterscotch]] had [[Litter #3]] on July 7, 2006 <br /> \nCaramel and [[Patches]] had [[Litter #4]] on January 18, 2008 <br />\n\n\nCaramel died during the birth of Litter #4.\n',NULL,1620,NULL);
