INSERT INTO `items` (`id`, `type`, `name`, `created_at`, `updated_at`, `info_node_info_node_id`, `body`, `value`, `sort_code`, `view`) VALUES (1690,'Section','wiki page','2008-07-07 13:27:47','2008-07-07 13:28:13',1689,'The Cisco Intelligent Services Gateway offers Service Providers an opportunity to take direct control of resources and characteristics in their broadband network to deliver next generation services by:\r\n\r\n* Controlling, securing & differentiating services via intelligent policies embedded directly in the network or received via open and standards-based control interfaces to the BSS \r\n* Customizing Service Convergence with zero-touch provisioning across customized networks \r\n* Distributing IP Session control into the network while simultaneously maintaining consistent PPP session control ',NULL,1690,NULL);
